import Carousel from "react-bootstrap/Carousel";
//import "bootstrap/dist/css/bootstrap.css"
import React, { useState } from 'react';

import "../ExamMaster/Createexam.css";
function Createexam() {

  const [formData, setFormData] = useState(new FormData());

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await fetch('https://localhost:8443/onlineexam/control/ExammasterEntity', {
        method: 'POST',
        body: formData,
        mode: 'no-cors'
      });

      if (!response.ok) {
        throw new Error('Network response was not ok');
      }

      // Handle successful submission
      console.log('Form submitted successfully');
    } catch (error) {
      console.error('Error submitting form:', error.message);
    }
  };

  return (
        <div className='subdivone'>
                      <div><p style={{color:'green',fontFamily:'sans-serif',textDecoration:'italic'}}>EXAM MASTER TABLE</p></div>
                <div className='subdiv'>
                <form action="" onSubmit={handleSubmit}>
                <div className='subdivtwo'>

              <div className="form-control">
                    <label htmlFor="">ExamId</label>
                    <input type="number" id='' placeholder='ExamId eg(1)' name=''/>
              </div>
              <div className="form-control">
                    <label htmlFor="">Examname</label>
                    <input type="text" id='' placeholder="Examname" name=''/>
              </div>
              <div className="form-control">
                   <label htmlFor="">Description</label>
                    <input type="text" id='' placeholder='Description'  name=''/>
              </div>
              <div className="form-control">
                    <label htmlFor="">Createdate</label>
                    <input type="date" id=''placeholder='none' name=''/>
              </div>
              <div className="form-control">
                    <label htmlFor="">Expirationdate</label>
                    <input type="date" id='' name=''/>
              </div>
              <div className="form-control">
                    <label htmlFor="">NoOfQuestions</label>
                    <input type="text" id=''placeholder='No of questions' name=''/>
              </div>
              </div>
              <div className='subdivtwo'>
              <div className="form-control">
                    <label htmlFor="">Durationminutes</label>
                    <input type="text" id='' placeholder='Duration Minutes eg(60-Minutes)' name=''/>
              </div>
              <div className="form-control">
                    <label htmlFor="">Passpercentage</label>
                    <input type="text" id='' placeholder='pass-percentage eg(25%)' name=''/>
              </div>
              <div className="form-control">
                    <label htmlFor="">QuestionsRandomized</label>
                    <input type='text' name="" id="" placeholder='questions randomized eg(Yes or No)' />

              </div>
              <div className="form-control">
                    <label htmlFor="">Answersmust</label>
                   <input type="text" name="" placeholder='To Answer is must eg(Y OR N)' id="" />
                    {/* <select name="" type="dropdown" id=""></select> */}
              </div>
              <div className="form-control">
                    <label htmlFor="">Enablenegativemark</label>
                    <input type="text" name="" placeholder='Enablenegativemark eg(Y OR N)' id="" />

              </div>
              <div className="form-control">
                    <label htmlFor="">NegativeMarkvalue</label>
                    <input type="text" placeholder='Negativemarkvalue eg(0.25)' id='' name=''/>

              </div>
              </div>
              <div style={{display:'flex', marginTop:'50px'}}>

                      <div>
                      <button type='submit' className='.button2' style={{marginright: '300px'}}>Next</button></div>

                      </div>
                </form>
                </div>

          </div>
    // <div>
    //   <form onSubmit={handleSubmit}>
    //     <div class="mb-3">
    //       <label for="exampleInputEmail1" class="form-label">
    //         Email address
    //       </label>
    //       <input
    //         type="email"
    //         class="form-control"
    //         id="exampleInputEmail1"
    //         aria-describedby="emailHelp"
    //       />
    //       <div id="emailHelp" class="form-text">
    //         We'll never share your email with anyone else.
    //       </div>
    //     </div>
    //     <div class="mb-3">
    //       <label for="exampleInputPassword1" class="form-label">
    //         Password
    //       </label>
    //       <input
    //         type="password"
    //         class="form-control"
    //         id="exampleInputPassword1"
    //       />
    //     </div>
    //     <div class="mb-3 form-check">
    //       <input type="checkbox" class="form-check-input" id="exampleCheck1" />
    //       <label class="form-check-label" for="exampleCheck1">
    //         Check me out
    //       </label>
    //     </div>
    //     <button type="submit" class="btn btn-primary">
    //       Submit
    //     </button>
    //   </form>
    // </div>
  );
}

export default Createexam;
